import React, { useEffect, useState } from 'react';
import { useSelector, useDispatch } from "react-redux";
import { Link } from 'react-router-dom';
import classes from './Search.module.css';
import footer_logo from '../app_bar/東大金融研究会_ロゴ.png';
import App_bar from '../app_bar/App_bar';

import {
    selectSheet,
    getSpredSheet,
} from "../company/companySlice";


const Search = () => {
    const dispatch = useDispatch();
    const sheet = useSelector(selectSheet);

    useEffect(async() => {
        const res = await dispatch(getSpredSheet())
    }, []);

    return (
        <div>
            <header>
                {sheet.info.elements.map((each_info) => (  
                    <App_bar id={each_info.id}/>
                ))}
            </header>
            <div className={classes.content}>
            <div className={classes.right_right_box}></div>
                <div className={classes.right_box}>
                    <div className={classes.right_box_box}>
                        <div className={classes.search_head}>
                            業界検索
                        </div>
                    </div>
                </div>
                <div className={classes.left_box}>
                    <div className={classes.company_head}>
                        企業欄
                    </div>
                    {sheet.info.elements.map((each_info) => (
                        <Link to={`/company/${each_info.ローマ字}/`}　className={classes.company_box} style={{ textDecoration: 'none', color: '#424242' }}>
                            <span className={classes.company_font}>{each_info.企業名}</span>
                            <br/>
                        </Link>
                    ))}
                </div>
            </div>
            <footer className={classes.footer_box}>
                <img src={footer_logo} className={classes.logo}/>
            </footer>
        </div>
    )
}

export default Search
